import axios from 'axios';
import {
  BrainCircuit,
  CheckCircle2, ChevronRight,
  ClipboardList,
  Dumbbell,
  HeartPulse,
  Info,
  Pill, Search,
  ShieldAlert, ShieldCheck, Stethoscope,
  Utensils
} from 'lucide-react';
import { useEffect, useState } from 'react';

const API_BASE = "http://127.0.0.1:8000";

export default function ModernPredictor() {
  const [symptoms, setSymptoms] = useState([]);
  const [selected, setSelected] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [results, setResults] = useState(null);
  const [isAnalyzing, setIsAnalyzing] = useState(false);

  useEffect(() => {
    axios.get(`${API_BASE}/symptoms`)
      .then(res => setSymptoms(res.data.symptoms || []))
      .catch(err => console.error("System Offline"));
  }, []);

  const toggleSymptom = (s) => {
    setSelected(prev => prev.includes(s) ? prev.filter(i => i !== s) : [...prev, s]);
  };

  const runAnalysis = async () => {
    if (selected.length === 0) return;
    setIsAnalyzing(true);
    try {
      const res = await axios.post(`${API_BASE}/predict`, { symptoms: selected });
      setResults(res.data);
    } catch (err) {
      alert("Neural Engine Error. Ensure Backend is active.");
    } finally {
      setIsAnalyzing(false);
    }
  };

  return (
    <div className="min-h-screen bg-[#F1F5F9] text-slate-900 font-sans antialiased selection:bg-indigo-500 selection:text-white">
      {/* Premium Navbar */}
      <nav className="sticky top-0 z-50 bg-white/70 backdrop-blur-2xl border-b border-slate-200/60">
        <div className="max-w-[1440px] mx-auto px-8 h-20 flex justify-between items-center">
          <div className="flex items-center gap-4">
            <div className="w-12 h-12 bg-gradient-to-tr from-indigo-600 to-violet-600 rounded-2xl flex items-center justify-center shadow-xl shadow-indigo-200 rotate-3">
              <BrainCircuit size={26} className="text-white -rotate-3" />
            </div>
            <div>
              <h1 className="text-xl font-black tracking-tight text-slate-900 leading-none">NEURO<span className="text-indigo-600">AI</span></h1>
              <p className="text-[10px] font-bold text-slate-400 uppercase tracking-[0.2em] mt-1">Diagnostic Intelligence</p>
            </div>
          </div>
          <div className="flex items-center gap-6">
            <div className="hidden md:flex flex-col items-end">
              <span className="text-[10px] font-bold text-slate-400 uppercase tracking-widest">Model Status</span>
              <span className="text-xs font-bold text-emerald-600 flex items-center gap-1.5">
                <span className="w-2 h-2 bg-emerald-500 rounded-full animate-ping" /> RF-CLASSIFIER READY
              </span>
            </div>
          </div>
        </div>
      </nav>

      <main className="max-w-[1440px] mx-auto px-8 py-10">
        <div className="grid lg:grid-cols-12 gap-10">

          {/* LEFT: SYMPTOM ENGINE */}
          <div className="lg:col-span-5 space-y-8">
            <div className="bg-white rounded-[2.5rem] p-10 shadow-2xl shadow-slate-200/60 border border-white">
              <div className="flex items-center gap-3 mb-8">
                <ClipboardList className="text-indigo-600" size={28} />
                <h2 className="text-3xl font-black tracking-tight">Select Symptoms</h2>
              </div>

              <div className="relative group mb-8">
                <Search className="absolute left-5 top-1/2 -translate-y-1/2 text-slate-400 group-focus-within:text-indigo-600 transition-colors" size={20} />
                <input 
                  type="text" 
                  placeholder="Search 130+ clinical markers..." 
                  className="w-full pl-14 pr-6 py-5 bg-slate-50 border-2 border-transparent rounded-[1.5rem] focus:bg-white focus:border-indigo-100 focus:ring-8 focus:ring-indigo-500/5 transition-all outline-none font-medium"
                  onChange={(e) => setSearchTerm(e.target.value)}
                />
              </div>

              <div className="h-[450px] overflow-y-auto pr-3 space-y-2 scrollbar-thin scrollbar-thumb-slate-200">
                {symptoms.filter(s => s.toLowerCase().includes(searchTerm.toLowerCase())).map(s => {
                  const isActive = selected.includes(s);
                  return (
                    <button
                      key={s}
                      onClick={() => toggleSymptom(s)}
                      className={`w-full group flex items-center justify-between p-4 rounded-2xl transition-all duration-300 ${
                        isActive 
                        ? 'bg-slate-900 text-white shadow-xl translate-x-1' 
                        : 'bg-white hover:bg-indigo-50/50 text-slate-600 border border-slate-100 hover:border-indigo-100 hover:translate-x-1'
                      }`}
                    >
                      <span className="capitalize font-bold text-sm tracking-tight">{s.replace(/_/g, ' ')}</span>
                      {isActive ? <CheckCircle2 size={18} className="text-indigo-400" /> : <div className="w-5 h-5 border-2 border-slate-200 rounded-lg group-hover:border-indigo-300 transition-colors" />}
                    </button>
                  );
                })}
              </div>

              <button 
                onClick={runAnalysis}
                disabled={selected.length === 0 || isAnalyzing}
                className="w-full mt-8 py-6 bg-gradient-to-r from-indigo-600 to-violet-600 text-white rounded-[1.5rem] font-black text-lg shadow-2xl shadow-indigo-200 hover:shadow-indigo-300 hover:scale-[1.02] active:scale-[0.98] transition-all disabled:opacity-20 flex items-center justify-center gap-3 uppercase tracking-wider"
              >
                {isAnalyzing ? "Processing Neural Map..." : "Initiate Diagnosis"}
                {!isAnalyzing && <ChevronRight size={24} />}
              </button>
            </div>
          </div>

          {/* RIGHT: CLINICAL DASHBOARD */}
          <div className="lg:col-span-7">
            {!results && !isAnalyzing ? (
              <div className="h-full min-h-[600px] bg-white/40 border-4 border-dashed border-white rounded-[3rem] flex flex-col items-center justify-center p-16 text-center">
                <div className="w-24 h-24 bg-white rounded-3xl shadow-xl flex items-center justify-center mb-8 rotate-12">
                  <HeartPulse className="text-slate-200" size={48} />
                </div>
                <h3 className="text-2xl font-black text-slate-400 uppercase tracking-widest">Awaiting Biomarkers</h3>
                <p className="text-slate-400 max-w-sm mt-4 font-medium leading-relaxed">Select manifesting symptoms to generate a cross-referenced clinical diagnosis.</p>
              </div>
            ) : isAnalyzing ? (
              <div className="space-y-6 animate-pulse">
                <div className="h-48 bg-white rounded-[3rem]" />
                <div className="grid grid-cols-2 gap-6">
                  <div className="h-64 bg-white rounded-[3rem]" />
                  <div className="h-64 bg-white rounded-[3rem]" />
                </div>
              </div>
            ) : (
              <div className="space-y-6 animate-in fade-in slide-in-from-bottom-8 duration-700">
                {/* Result Hero */}
                <div className="bg-slate-900 rounded-[3rem] p-12 shadow-2xl relative overflow-hidden group">
                  <div className="absolute top-0 right-0 w-64 h-64 bg-indigo-500/10 rounded-full blur-3xl -mr-20 -mt-20 group-hover:bg-indigo-500/20 transition-all duration-1000" />
                  <div className="relative z-10">
                    <div className="flex items-center gap-3 text-indigo-400 mb-6 font-black uppercase tracking-[0.3em] text-[10px]">
                        <Stethoscope size={18} />
                        Diagnostic Prediction
                    </div>
                    <h1 className="text-6xl font-black text-white mb-8 tracking-tighter leading-[0.9]">{results.disease}</h1>
                    <div className="flex items-start gap-4 p-6 bg-white/5 rounded-3xl border border-white/10 backdrop-blur-md">
                        <Info size={24} className="text-indigo-400 shrink-0 mt-1" />
                        <p className="text-slate-300 text-sm leading-relaxed font-medium italic">"{results.description}"</p>
                    </div>
                  </div>
                </div>

                {/* Treatment & Lifestyle Grid */}
                <div className="grid md:grid-cols-2 gap-6">
                  {/* Medical (Rx) */}
                  <div className="bg-white rounded-[2.5rem] p-8 shadow-xl shadow-slate-200/40 border border-slate-100">
                    <div className="flex items-center gap-3 mb-6 text-rose-600">
                      <div className="p-2 bg-rose-50 rounded-xl"><Pill size={22} /></div>
                      <h3 className="font-black uppercase tracking-wider text-sm">Medical Protocol</h3>
                    </div>
                    <div className="space-y-3">
                      {results.medications?.map((m, i) => (
                        <div key={i} className="px-5 py-4 bg-rose-50/50 text-rose-700 rounded-2xl text-xs font-black border border-rose-100/50 flex items-center justify-between">
                          {m}
                          <div className="w-1.5 h-1.5 bg-rose-400 rounded-full" />
                        </div>
                      ))}
                    </div>
                  </div>

                  {/* Precautions */}
                  <div className="bg-white rounded-[2.5rem] p-8 shadow-xl shadow-slate-200/40 border border-slate-100">
                    <div className="flex items-center gap-3 mb-6 text-emerald-600">
                      <div className="p-2 bg-emerald-50 rounded-xl"><ShieldCheck size={22} /></div>
                      <h3 className="font-black uppercase tracking-wider text-sm">Clinical Safety</h3>
                    </div>
                    <ul className="space-y-4">
                      {results.precautions?.map((p, i) => (
                        <li key={i} className="flex gap-4 text-xs text-slate-600 leading-snug font-bold">
                          <div className="w-5 h-5 bg-emerald-500 rounded-full flex items-center justify-center shrink-0 mt-0.5 text-white"><CheckCircle2 size={12} /></div>
                          {p}
                        </li>
                      ))}
                    </ul>
                  </div>

                  {/* Dietary Guidance */}
                  <div className="bg-white rounded-[2.5rem] p-8 shadow-xl shadow-slate-200/40 border border-slate-100">
                    <div className="flex items-center gap-3 mb-6 text-amber-600">
                      <div className="p-2 bg-amber-50 rounded-xl"><Utensils size={22} /></div>
                      <h3 className="font-black uppercase tracking-wider text-sm">Nutritional Support</h3>
                    </div>
                    <div className="flex flex-wrap gap-2">
                        {results.diets?.map((d, i) => (
                            <span key={i} className="px-4 py-2 bg-amber-50 text-amber-700 rounded-xl text-[10px] font-black border border-amber-100/50 uppercase tracking-widest">
                                {d}
                            </span>
                        ))}
                    </div>
                  </div>

                  {/* Recovery Activity */}
                  <div className="bg-white rounded-[2.5rem] p-8 shadow-xl shadow-slate-200/40 border border-slate-100">
                    <div className="flex items-center gap-3 mb-6 text-indigo-600">
                      <div className="p-2 bg-indigo-50 rounded-xl"><Dumbbell size={22} /></div>
                      <h3 className="font-black uppercase tracking-wider text-sm">Physical Therapy</h3>
                    </div>
                    <div className="p-5 bg-indigo-50/50 rounded-2xl border border-indigo-100/50">
                        <p className="text-xs text-indigo-900 font-bold leading-relaxed">{results.workout}</p>
                    </div>
                  </div>
                </div>

                {/* Professional Disclaimer */}
                <div className="p-6 bg-slate-900 rounded-[2rem] flex gap-5 items-center">
                    <ShieldAlert className="text-amber-500 shrink-0" size={32} />
                    <p className="text-[10px] text-slate-400 font-bold uppercase tracking-tight leading-relaxed">
                        Notice: This diagnosis is generated by a Random Forest machine learning model. It is intended for educational screening and does not constitute a legal medical diagnosis. Consult a physician for clinical confirmation.
                    </p>
                </div>
              </div>
            )}
          </div>
        </div>
      </main>
    </div>
  );
}
